import React from 'react';
import './myStyle.css'
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
export default function Home(){
    return(
        <div className='home'>
        <h1></h1>
          <p> מטרת הקמת האתר נועדה על מנת לקהל על משתמשיה</p>
          <p>אנו צוות האתר מודעים לקושי של משתמשינו (לרוב מנהלי חברות) לעקוב אחר לקוחתיהם</p>
          <p>דבר זה צורך קריאה של מיילים שעות של עבודה ובזבוז כסף וכח אדם</p>
          <p>אתרינו מציע ממשק קל ונוח למשתמש אשר בלחיצת כפתור יוכל לחסוך רבות</p>
          <p>אנו מקווים שתהיה לך חווית גלישה טובה  ומועילה ביותר</p>
        </div>
    )
}
